import { Card,CardActionArea,CardMedia,CardContent, Typography,CardActions,makeStyles, Button } from '@material-ui/core';



const useStyles = makeStyles((theme) => ({
  media:{
    height: 250,
    [theme.breakpoints.down("sm")]:{
      height: 150,
    },
  },
  card:{
    marginBottom: theme.spacing(3),
  },
}));
export default function Post() {
  const classes = useStyles();

  return (
    <Card className={classes.card}>
      <CardActionArea>
        <CardMedia className={classes.media} image="https://material-ui.com/static/images/cards/paella.jpg" />
        <CardContent>
          <Typography gutterBottom variant="h5">My first post</Typography>
          <Typography variant="body">Lorem ipsum</Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small" color="primary">
          Share
        </Button>
        <Button size="small" color="primary">
          Learn more
        </Button>
      </CardActions>
    </Card>
  );
}
